import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
 border: solid 5px white;
`

const Movie = ({title}) => {
 console.log(title)
 return (
  <Wrapper>
   <h1>{title}</h1>
  </Wrapper>
 )
}

export default Movie
